(671, 199, 'Front of house from road', '107_houseinloomberahfromfrontgate.jpg', 'thumb_107_houseinloomberahfromfrontgate.jpg', 'Front of house from gate overlooking the valley towards the East with unsurpassed views. Property has stables and animal enclosures with well fenced medium sized paddocks and main paddock for livestock.', 107, 1, 'yes'),
(672, 199, 'Backyard', '107_backgardenandviewstosoutheast.jpg', 'thumb_107_backgardenandviewstosoutheast.jpg', 'Backyard and views to the south east', 107, 2, 'yes'),
(673, 199, 'Back decking', '107_backofhousewithdrawnallweatherblinds.jpg', 'thumb_107_backofhousewithdrawnallweatherblinds.jpg', 'Back decking and BBQ area looking towards back of house with all weather blind system. New in 2007', 107, 3, 'yes'),
(674, 199, 'BBQ area', '107_deckingandbbqarea.jpg', 'thumb_107_deckingandbbqarea.jpg', 'Relax and look over the valley to unspurassed views to the east and south east whilst enjoying outdoor living', 107, 4, 'yes'),
(675, 199, 'Lounge Room', '107_loungeroomview2.jpg', 'thumb_107_loungeroomview2.jpg', 'Large room with access to all parts of house. Wood floating floors. Vulcan fireplace and split system air conditioning. Overlooking valley views.', 107, 5, 'yes'),
(676, 199, 'Dining Room', '107_diningroom.jpg', 'thumb_107_diningroom.jpg', 'Formal dingin with access to kitchen through servery. Seating up to 10 with ease.', 107, 6, 'yes'),
(677, 199, 'Kitchen', '107_kitchen.jpg', 'thumb_107_kitchen.jpg', 'Commercial stainless stell gas/electric stove and oven. Dishawasher. ROom for large fridge and freezer. Ample cupboards and pantry. Views over valley whilst preparing meals.', 107, 7, 'yes'),
(678, 199, 'Bathroom', '107_bathroom.jpg', 'thumb_107_bathroom.jpg', 'Large bathroom with bath and shower. Larger than normal size for ease of movement. Separate toilet adjacent.', 107, 8, 'yes'),
(679, 199, 'Bedroom', '107_bedroom.jpg', 'thumb_107_bedroom.jpg', 'House has 4 bedrooms - 3 with buit ins and one without. All queen size bedrooms. Main bedroom has mirrored wardrobe.', 107, 9, 'yes'),
(680, 199, 'Sunroom/Family Room', '107_sunroom,familyroom,sleepout.jpg', 'thumb_107_sunroom,familyroom,sleepout.jpg', 'This room is very roomy for a sleep out/sunroom room or family room. Plenty of space for exercise equipment or games room.', 107, 10, 'yes'),
