(1485, 322, 'Frontal view', '207_dsc00404.jpg', 'thumb_207_dsc00404.jpg', '<strong>Street appeal, 1st letter-box.&nbsp; Note large Elk horn to the left on tree.&nbsp; Sub-tropical area - stunning weather to live in.</strong>', 207, 2, 'yes'),
(1495, 322, 'Galley Kitchen Downstairs', '207_dsc00384.jpg', 'thumb_207_dsc00384.jpg', '<strong>Tasmanian Oak kitchen with wall oven and ceramic hot plates with range hood over.&nbsp;&nbsp; Secure rear door in flat at end of kitchen leads directly to under cover car port.</strong>', 207, 9, 'yes'),
(1494, 322, 'Downstairs Lounge', '207_dsc00385.jpg', 'thumb_207_dsc00385.jpg', '<strong>Open plan living.&nbsp; Tiled floors, double sliding window leads to private alcove.&nbsp; Seperate telephone and internet &nbsp;connections to house above.</strong>', 207, 8, 'yes'),
(1497, 322, 'Rain forest at rear', '207_dsc00415.jpg', 'thumb_207_dsc00415.jpg', '', 207, 10, 'yes'),
(1490, 322, ' Upstairs Kitchen', '207_dsc00393.jpg', 'thumb_207_dsc00393.jpg', '<strong>Electric wall oven, ceramic hot plates with s/s range hood.&nbsp; Loads of cupboards.&nbsp; Large pnatry.&nbsp; This is only half of kitchen.</strong>', 207, 5, 'yes'),
(1489, 322, 'Sundeck', '207_dsc00390.jpg', 'thumb_207_dsc00390.jpg', '<strong>After a shower of rain,Sun shades filter light.&nbsp; Retractable clothes line.&nbsp; Note. flat hand-rail for easy use when entertaining - &nbsp;B B Q plates or drinks.</strong>', 207, 3, 'yes'),
(1493, 322, '2nd Dwelling Entrance', '207_dsc00386.jpg', 'thumb_207_dsc00386.jpg', '<strong>Downstairs dwelling has industrial strength securtiy screens and windows.&nbsp; 3 x Dble power point outlets strategically placed outside.</strong>', 207, 7, 'yes'),
