(2356, 402, 'Kitchen.', '303_photo11.jpg', 'thumb_303_photo11.jpg', '<span style=\"font-family: Arial\" class=\"Apple-style-span\">Across the      breakfast bar from the kitchen is the family room with tiled floor and large glass sliding      doors opening onto the covered patio area. The laundry is adjacent to the family room.</span>', 303, 9, 'yes'),
(2355, 402, 'Bathroom.', '303_photo10.jpg', 'thumb_303_photo10.jpg', 'The three-way bathroom allows for separate use of the bathroom, vanity and toilet. A large skylight over the vanity bench provides excellent daylight.&nbsp;', 303, 8, 'yes'),
(2353, 402, 'The Dinning Room', '303_photo8.jpg', 'thumb_303_photo8.jpg', '<p>The dinning room is adjacent to the kitchen and lounge room and has tiled floors and a view onto the patio and rear garden area. This room also provides internal access to the garage.</p><p>&nbsp;</p><p>&nbsp;</p>', 303, 6, 'yes'),
(2354, 402, 'Bedroom 2.', '303_photo9.jpg', 'thumb_303_photo9.jpg', 'Good sized room with two built-in wardrobes and is adjacent to the bathroom.', 303, 7, 'yes'),
(2352, 402, 'Master Bedroom.', '303_photo7.jpg', 'thumb_303_photo7.jpg', 'The master bedroom is light and airly with a view of the landscaped front garden. Large built-in wardrobe with mirror doors. This bedroom includes an ensuite.&nbsp;', 303, 5, 'yes'),
(2350, 402, 'Covered Patio.', '303_photo4.jpg', 'thumb_303_photo4.jpg', '<span style=\"font-family: Arial\" class=\"Apple-style-span\">Good sized      covered patio area with deciduous plants for winter sun and summer shade.</span>', 303, 3, 'yes'),
(2351, 402, 'Lounge Room.', '303_photo5.jpg', 'thumb_303_photo5.jpg', 'Large separate lounge room with natural light from windows at the front and through the adjacent dinning room.&nbsp;<span style=\"font-family: Arial\" class=\"Apple-style-span\">Reverse cycle      air conditioning as well as gas reticulation to points in the lounge,      family room and study.</span>', 303, 4, 'yes'),
(2349, 402, 'North facing rear yard.', '303_photo3.jpg', 'thumb_303_photo3.jpg', '<span style=\"font-family: Arial\" class=\"Apple-style-span\">The double      garage, under the main roof, has an automatic door and roller door access      to the back yard as well as internal access to the house. E</span><span style=\"font-family: Arial\" class=\"Apple-style-span\">conomical      roof top 300ltr solar hot water system.</span>', 303, 2, 'yes'),
(2348, 402, 'View from Ablett Court.', '303_photo1.jpg', 'thumb_303_photo1.jpg', '<span style=\"font-family: Arial\" class=\"Apple-style-span\">Quiet      cul-de-sac location a few minutes walk to shops, clubs, golf course, Seven Mile      Beach and Shoalhaven River. L</span><span style=\"font-family: Arial\" class=\"Apple-style-span\">ow      maintenance landscaped garden area with low water use, native plants.</span>', 303, 1, 'yes'),
