(2357, 402, 'Bedroom 3.', '303_photo12.jpg', 'thumb_303_photo12.jpg', '<span style=\"font-family: Arial\" class=\"Apple-style-span\">The large 3rd      bedroom has a early morning sunny outlook onto the rear garden and includes a good sized storage room (possible walk-in-robe or study area)</span>', 303, 10, 'yes'),
