(2733, 447, 'A glimpse of Tanglewood', '348_compilationoftanglewood.jpg', 'thumb_348_compilationoftanglewood.jpg', 'Clockwise from top left - Treefern gully; guest bathroom with bath, wheelchair accessible shower, heater/fan/lights; from kitchen to living room, breezeway, library and rear deck; Living with log fire; laundry with ample storage, through to guest bathroom storage, built in ironing board, room for spare fridge/freezer; rear deck for al fresco dining and entertaining; Living to kitchen, access to front deck on right, solar tubes for natural lighting in kitchen; gourmet kitchen, entry to study on right; guest bedroom; front walkway to deck for spa/pool (not included); swimming hole at creek; part of view from rear deck.', 348, 1, 'yes'),
(2734, 447, 'Gourmet Kitchen', '348_galley.jpg', 'thumb_348_galley.jpg', 'Hardwood floors provide back pain free cooking in this beautiful kitchen. 5.5m long with solid Maple Silkwood benchtops, Oliveri double sink, Smeg cooker, dishwasher and ample space for double fridge/freezer if preferred, walk in pantry, appliance garages - a dream to entertain with.', 348, 2, 'yes'),
