(4131, 575, 'Kitchen', '481_picture2.jpg', 'thumb_481_picture2.jpg', '<p><font face=\"Times New Roman\" size=\"3\">  </font><span style=\"line-height: 115%; font-family: \'Arial\',\'sans-serif\'; font-size: 9pt\">Modern open plan kitchen with 2 pac finish. Quality stainless steel appliances and a large walk in pantry.</span></p><p><font face=\"Times New Roman\" size=\"3\">  </font></p>', 481, 6, 'yes'),
(4132, 575, 'Outdoor entertaining area', '481_picture3.jpg', 'thumb_481_picture3.jpg', '<p><font face=\"Times New Roman\" size=\"3\"> </font><span style=\"line-height: 115%; font-family: \'Arial\',\'sans-serif\'; font-size: 9pt\">Features a large open wood fire with a pizza oven, built in BBQ and a stainless steel bench top and cupboards</span></p><p><font face=\"Times New Roman\" size=\"3\">  </font></p>', 481, 13, 'yes'),
(4133, 575, '', '481_picture4.jpg', 'thumb_481_picture4.jpg', '', 481, 12, 'yes'),
(4134, 575, 'Main Bathroom', '481_picture5.jpg', 'thumb_481_picture5.jpg', '<p><font face=\"Times New Roman\" size=\"3\"> </font><span style=\"line-height: 115%; font-family: \'Arial\',\'sans-serif\'; font-size: 9pt\">Features include an extra large bath, vanity with lots of storage and a tiled shower. Main bathroom joins a powder room and a separate toilet.</span></p><p><font face=\"Times New Roman\" size=\"3\">  </font></p>', 481, 11, 'yes'),
(4135, 575, 'Main Bedroom', '481_picture6.jpg', 'thumb_481_picture6.jpg', '<p><font face=\"Times New Roman\" size=\"3\"> </font><span style=\"line-height: 115%; font-family: \'Arial\',\'sans-serif\'; font-size: 9pt\">Leads out onto a separate grassed yard. Very spacious room with huge walk in robe and ensuite.</span></p><p><font face=\"Times New Roman\" size=\"3\">  </font></p>', 481, 9, 'yes'),
