(11202, 1102, 'Kitchen. 3.5m Long x 3.2m Wide.', '1037_201706213.jpg', 'thumb_1037_201706213.jpg', 'Modern Kitchen,Professionally Installed In 2014.\r\nAmple Over Head Storage And Under Cupboard Storage With Quality Soft Close Blum Fittings and 3 Tier Draws For Even The Biggest Pots And Pans.\r\nEasy Clean Modern Looking Bench Top.\r\nBig 900m Electric Oven With 5 Cook-top Places.\r\nFeatured In An Easterly Position To Take Advantage Of The Morning Sun In Winter.\r\nFridge Space Fits 580L Fridge.\r\n600mm x 600mm Ultra Modern Look Grey Floor Tiles Professionally Layed.\r\nAll Windows Are Security Screened.\r\nInsulated Ceiling.', 1037, 2, 'yes'),
(11215, 1102, 'Bedroom 3.  4.0m Long x 3.1m Wide', '1037_2017062111.jpg', 'thumb_1037_2017062111.jpg', 'Nice Large Bedroom With Built In That Boasts  Lots Of Hanging Space.\r\nLarge Window To allow Natural Light In.\r\nSituated On The Westerly Side Of The House And Is Shaded From The Westerly Sun.\r\nHigh Ceiling And Ceiling Fan Plus Reverse Cycle Air Conditioner.\r\nCarpeted.\r\nWindow Security Screened.', 1037, 10, 'yes'),
(11214, 1102, 'Ensuite. 2.4m Long x 2.0m Wide.', '1037_2017062110.jpg', 'thumb_1037_2017062110.jpg', 'Great Little Addition To The Main Bedroom And Very Convenient For An Elderly Couple Who Don\'t Like To Walk Too Far Of A Night Time To Use Toilet!\r\nWell Set Out With A His And Her\'s Mirror Designed For The Lady To Do Her Makeup Under A Well Lit Light And The Mirror Above Vanity For The Man To Shave Etc.\r\n3 in 1 Light, Heat Lamp and Exhaust Fan.\r\nFully Tiled And Wet Sealed For Long Term Durability.\r\nWell Lit With Natural Light.\r\nInsulated Ceiling.\r\nWindow Security Screened.', 1037, 9, 'yes'),
(11206, 1102, 'Dining Room. 3.8m Long x 3.05m Wide.', '1037_201706215.jpg', 'thumb_1037_201706215.jpg', 'This Separate Dining Room Is Big Enough To Host A 8 Seat Dining Table.\r\nHigh Ceiling and A Ceiling Fan Plus A Reverse Cycle Air Conditioner.\r\nBay Window With A Cute Window Seat With Flip Up Lid That Is Great For Vacuum Storage Or Just Bits And Pieces You Want Kept Out Of Sight.\r\n600mm x 600mm Sandstone Clean Looking Floor Tiles Professionally Layed.\r\nAll Windows Are Security Screened.', 1037, 4, 'yes'),
(11208, 1102, 'Bedroom 2. 3.2m Long x 3.05m Wide.', '1037_201706216.jpg', 'thumb_1037_201706216.jpg', 'Nice Medium Sized Bedroom That Can Comfortably Fit A Queen Sized Bed Or 2 Bunk Beds.\r\nCarpeted and Situated On The Westerly Side Of The House With Plenty Of Shade For Those Hot Summers.\r\nHigh Ceiling And Ceiling Fan Plus Reverse Cycle Air Conditioner.\r\nWindow Is Security Screened.', 1037, 5, 'yes'),
(11213, 1102, 'Main Bedroom With Ensuite. 4.1m Long x 2.9m Wide.', '1037_201706219.jpg', 'thumb_1037_201706219.jpg', 'Spacious Enough To Fit A King Size Bed With 2 Side Cup Boards.\r\nCeiling Fan Plus Reverse Cycle Air Conditioner.\r\nNaturally Well  Lit, Warm  And Airy Being Situated On The North Eastern Side Of The Property.\r\nInsulated Ceiling Makes For a Very Functional Comfortable Room In Hot And Cold Conditions. \r\nCarpeted And Cosy.\r\nWindow Security Screened.', 1037, 8, 'yes'),
(11210, 1102, 'Main / Visitor Toilet. Shower Over Bath. 2.5m Long x 2.0m Wide.', '1037_201706217.jpg', 'thumb_1037_201706217.jpg', 'Clean And Well Lit Toilet, Shower Over Bath and Vanity All White. \r\nWell Maintained With Quality Tap Fittings.\r\n3 in 1 Light, Heat Lamp and Exhaust Fan.\r\nFully Tiled And Wet Sealed For Long Term Durability.\r\n2 Door Vanity With Adequate Storage Space and Tile Mirror Above It For Teeth Brushing/Make Up Application.\r\nWindow Security Screened. \r\nInsulated Ceiling.', 1037, 6, 'yes'),
(11212, 1102, 'Lounge Room. 4.95m Long x 3.3m Wide.', '1037_201706218.jpg', 'thumb_1037_201706218.jpg', 'Medium Sized Lounge Room With High Ceilings And Ceiling Fan.\r\nCarpeted, Comfortable And Roomy Enough To Add More Seats For When Visitors Come Over.\r\nAdded Advantage Of Being Able To Watch T.V. From The Kitchen Whilst Cooking!\r\nSkylight Installed To Allow For Natural Light During The Day.', 1037, 7, 'yes'),
(11250, 1106, '', '1041_img20170128161646.jpg', 'thumb_1041_img20170128161646.jpg', '', 1041, 2, 'yes'),
(11248, 1102, 'Walk Through Pantry. 2.0m x 2.0m.', '1037_20150520112654.jpg', 'thumb_1037_20150520112654.jpg', 'Walk through pantry with enough storage space for the biggest of families!', 1037, 3, 'yes'),
(11249, 1106, '', '1041_img20170128155151.jpg', 'thumb_1041_img20170128155151.jpg', '', 1041, 1, 'yes'),
(11221, 1102, 'Downstairs Laundry Area. 2.5m x 2.5m.', '1037_2017062113.jpg', 'thumb_1037_2017062113.jpg', 'Tiled Laundry Area With Direct Access To Undercover Clothes Hanging Area.', 1037, 11, 'yes'),
(11223, 1102, 'Backyard.', '1037_2017062115.jpg', 'thumb_1037_2017062115.jpg', 'Fully Fenced Back Yard Nice And Private With Double Lock Up Garage And Single Separate Powered Garage.\r\n', 1037, 14, 'yes'),
(11224, 1102, '3rd Shower/Gardener\'s Shower and Linen Cupboard.', '1037_20170621121.jpg', 'thumb_1037_20170621121.jpg', 'This 3rd Shower Is Situated Next To The Laundry And Just A few Steps From The Back Door Allowing The Avid Gardener To Duck Into The Shower Without Fear Of Carrying Mud Up Through The House.\r\nGreat Addition And Super Handy For When Hubby Decides To Tinker On The Car And Get Greasy.\r\nFully Tiled With Ample Towel And Linen Storage Space.', 1037, 12, 'yes'),
