(15115, 1391, 'Lounge Room East Wing', '1343_img1252.jpg', 'thumb_1343_img1252.jpg', 'Its a huge Lounge room as you can see by the furnishings - beautiful wood fire to keep you warm in the winter and loads of space to lay on the floor in front of it. Could easily accommodate a massive lounge.', 1343, 5, 'yes'),
(15116, 1391, 'Dining Room with an 8 seater table, piano, arm chair and sideboard - its a huge room', '1343_img1281.jpg', 'thumb_1343_img1281.jpg', 'The dining room faces the street. We would be lucky to have 20 cars go by a day - so peaceful.  Across the road is the recreational ground boasting tennis courts, club rooms and rodeo ground. Camping is available through council in approved times. ', 1343, 10, 'yes'),
(15117, 1391, 'Back Deck western side ', '1343_img1266.jpg', 'thumb_1343_img1266.jpg', 'The steel shutter keep the heat and the cold out. Allows the sun in the afternoon in the winter to warm you whilst you relax in the garden ', 1343, 3, 'yes'),
(15118, 1391, 'Granny Flat - used as a beauty salon approved by council. ', '1343_img1280.jpg', 'thumb_1343_img1280.jpg', 'Mens shed on the right of this with ceiling fans, work bench and more', 1343, 14, 'yes'),
(15119, 1391, 'Back Deck and grading facing the Granny Flat', '1343_img1268.jpg', 'thumb_1343_img1268.jpg', 'Two stools and a rail is the perfect place to sit and admire the evergreen, easy maintenance garden. ', 1343, 4, 'yes'),
(15120, 1391, 'Country village life - perfect ', '1343_img1261.jpg', 'thumb_1343_img1261.jpg', '', 1343, 4, 'yes'),
(15121, 1391, 'Lounge room West wing', '1343_img1271.jpg', 'thumb_1343_img1271.jpg', '', 1343, 6, 'yes'),
(15122, 1391, 'These are the Doors that separate the West wing from the East wing allows the light.', '1343_img1263.jpg', 'thumb_1343_img1263.jpg', '', 1343, 11, 'yes'),
(15123, 1391, 'Kitchen From the dining room ', '1343_img1277.jpg', 'thumb_1343_img1277.jpg', '', 1343, 7, 'yes'),
(15124, 1391, 'Pergola Garden on the West side of the house.', '1343_img1257.jpg', 'thumb_1343_img1257.jpg', '', 1343, 15, 'yes'),
(15125, 1391, 'Kitchen coming from the west wing lounge room ', '1343_img1275.jpg', 'thumb_1343_img1275.jpg', '', 1343, 1, 'yes'),
(15126, 1391, 'Beautiful Pool with 3 huge shade sales and large seating area. ', '1343_img1255.jpg', 'thumb_1343_img1255.jpg', 'Undercover BBQ area and clothes line', 1343, 12, 'yes'),
(15127, 1391, 'Back Deck next to the swimming pool', '1343_img1270.jpg', 'thumb_1343_img1270.jpg', 'Huge Steel back deck, lined with timber and painted white. 2 ceiling fans and post lights for easy entertaining and comfort. ', 1343, 2, 'yes'),
(15128, 1391, 'Kitchen with having pot rack from dining room ', '1343_img1279.jpg', 'thumb_1343_img1279.jpg', 'Electric Stove, gas bottled hot water, Thermomix negotiable lol, plate rack, post and pans rack, huge bench loads of cupboards, lots of powerpoints. ', 1343, 9, 'yes'),
